import React, { Component } from 'react'
import Logo from './logo/Logo'
import RegFizMid from './RegFizMid'

class RegFiz extends Component {

    render() {
        return (
            <div className="wrapper">
                <Logo />
                <RegFizMid />
            </div>
        )
    }
}

export default RegFiz
